import styled from 'styled-components'
import { color } from '../public/screensizes'

const Container = styled.div`
  display: flex;
  flex-flow: column;
`

const Title = styled.h3`
  font-family: 'Industry';
  font-weight: bold;
  color: ${color.jctOrange};
  font-size: 1.8rem;
`


const Alarms = props => (
  <Container>
    <Title>Alarms</Title>

    <ul>
      <li>On: {props.on}</li>
      <li>Off: {props.off}</li>
    </ul>
  </Container>
)

export default Alarms
